BEGIN TRANSACTION;


DROP TABLE IF EXISTS diary_meal_entries;
DROP TABLE IF EXISTS diary_meal_types;
DROP TABLE IF EXISTS diary;
DROP TABLE IF EXISTS profiles;
DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS foods;

DROP SEQUENCE IF EXISTS seq_user_id;

CREATE SEQUENCE seq_user_id
  INCREMENT BY 1001
  NO MAXVALUE
  NO MINVALUE
  CACHE 1;




CREATE TABLE users (
	user_id int DEFAULT nextval('seq_user_id'::regclass) NOT NULL,
	username varchar(50) NOT NULL,
	password_hash varchar(200) NOT NULL,
	role varchar(50) NOT NULL,
	CONSTRAINT PK_user PRIMARY KEY (user_id)
);

CREATE TABLE profiles(
        profile_id serial,
        user_id INT NOT NULL,
        first_name varchar(100) NOT NULL,
        last_name varchar(100) NOT NULL,
        age int NOT NULL,
        height decimal NOT NULL,
        current_weight decimal NOT NULL,
        goal_weight decimal NOT NULL,
        birthday date NOT NULL,
        profile_picture varchar(200),
        CONSTRAINT PK_profile PRIMARY KEY (profile_id),
        CONSTRAINT FK_user FOREIGN KEY (user_id) REFERENCES users (user_id)
);


CREATE TABLE diary(
        diary_id serial,
        profile_id int NOT NULL UNIQUE,
        CONSTRAINT PK_diary PRIMARY KEY (diary_id),
        CONSTRAINT FK_profile FOREIGN KEY (profile_id) REFERENCES profiles (profile_id)

);

CREATE TABLE foods(
        food_id serial,
        food_name varchar(200) NOT NULL,
        calories int NOT NULL,
        fat decimal(5,2) NOT NULL,
        protein decimal(5,2) NOT NULL,
        carbohydrate decimal(5,2) NOT NULL,
        serving_size varchar(100),
        food_group  varchar(100),

        CONSTRAINT PK_food PRIMARY KEY (food_id)
);



CREATE TABLE diary_meal_types(
       diary_meal_type_id serial,
       diary_meal_type_description varchar(64) NOT NULL,

       CONSTRAINT PK_meal_type PRIMARY KEY (diary_meal_type_id)
);

CREATE TABLE diary_meal_entries(
    diary_meal_entry_id serial,
    diary_id INT NOT NULL,
    diary_meal_entry_date date not null,
    diary_meal_type_id INT NOT NULL,
    food_id INT NOT NULL,
    serving_size varchar(100),
    number_of_servings decimal(5,2) NOT NULL,


    CONSTRAINT PK_meal_entries PRIMARY KEY (diary_meal_entry_id),
    CONSTRAINT FK_diary FOREIGN KEY (diary_id) REFERENCES diary (diary_id),
    CONSTRAINT FK_meal_type FOREIGN KEY (diary_meal_type_id) REFERENCES diary_meal_types (diary_meal_type_id),
    CONSTRAINT FK_food_id FOREIGN KEY (food_id) REFERENCES foods (food_id)



);




COMMIT TRANSACTION;


